import web3 from './web3';
import ElectionFactory from './Build/ElectionFact.json';

// Check if ABI exists
if (!ElectionFactory.abi) {
    throw new Error("ABI not found in contract JSON");
}

// Create contract instance
const instance = new web3.eth.Contract(
    ElectionFactory.abi,
    '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8' // Replace with your actual address
);

export default instance;
